import React from 'react';

export const PetAdvice = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <div className="flex flex-col md:flex-row">
        <div className="md:w-1/2 p-4 bg-gray-100">
          <h2 className="text-xl font-semibold mb-2">Pet Adoption Checklist: 10 Things to Consider Before Adopting a Pet</h2>
          <img
            src="../../../uploads/adoptionAdvice.webp" // Replace this with your image URL
            alt="Pet Adoption"
            className="mb-4 w-full h-auto" // Responsive image
          />
          <p>This is the content for the left column.</p>
        </div>
        <div className="md:w-1/2 p-4 bg-gray-200">
          <h2 className="text-xl font-semibold mb-2">Right Column</h2>
          <p>This is the content for the right column.</p>
        </div>
      </div>
    </div>
  );
};
